export const Controls = ({ decrement, increment }) => {
  return (
    <div>
      <button type="button" onClick={decrement}>
        Увеличить на 1
      </button>
      <button type="button" onClick={increment}>
        Уменьшить на 1
      </button>
    </div>
  );
};
